import React from "react";
//import "src\images\temp_img.jpg";

const Service = () => {
    return(
        <>
           <div className="my-5">
                <h1 className="text-center">Our Services</h1>
           </div>
           <div className="container-fluid">
                <div className="row">
                    <div className="col-10 mx-auto"></div>
                </div>
            </div>
        </>
    );
};

export default Service;
